import { Link } from "react-router-dom";
import { useContext } from "react";
import { AuthContext } from "../contexts/AuthContext";
import { useNavigate } from "react-router";



const NavBar = () => {

    const navigate = useNavigate();

    const userLog = useContext(AuthContext);
    const { isLoggedIn } = userLog;


    const handleLogOut = () => {
        userLog.toggleAuth(null)
        navigate("/")
    }
    "isLoggedIn-->"
    return (
        <div>
            <ul class="nav nav-pills">
                <li class="nav-item">
                    <Link to="/"><a class="nav-link active">Home</a></Link>
                </li>
                <li class="nav-item">
                    <Link to="/login"><a class="nav-link">Login</a></Link>
                </li>
                <li class="nav-item">
                    <button onClick={handleLogOut}><a class="nav-link">logOut</a></button>
                </li>
                <li class="nav-item">
                    <Link to="/register"><a class="nav-link" href="#">Sign up</a></Link>
                </li>
                {/* <li class="nav-item">
                    {userLog.isLoggedIn.user ? <h3 class="nav-link" href="#">Welcome back</h3>}

                </li> */}
            </ul>
        </div>
    )
};

export default NavBar;
